;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-var'>#&#x27;aircraft/nas-avg</span>","value":"#'aircraft/nas-avg"},{"type":"html","content":"<span class='clj-var'>#&#x27;aircraft/avg-nas-beg</span>","value":"#'aircraft/avg-nas-beg"}],"value":"[#'aircraft/nas-avg,#'aircraft/avg-nas-beg]"}
;; <=

;; @@
(list-plot avg-nas-beg :color "#00cccc" 
           :plot-range [[0 N] [0 10]]
           :joined true
           :y-title "Number of Aircraft"
           :x-title "MH Iterations")
